description:
organ Chanel - Daddy's Worst Nightmare
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Poor little Morgan, she needed a new friend, what she was looking for was a well hung African. So she went for a walk all through the park, and it was there she met a brotha that was really dark. She asked how it was hanging and so he replied, if you really want to know take if for a ride. Poor little Morgan and her poor little twat, I wonder what daddy thinks about his daughter that can barely walk!

